import React from 'react';

function Navbar({ onLogout }) {
  return (
    <nav className="navbar">
      <div className="navbar-logo">MyParkingSpace</div>
      <div className="navbar-profile">
        <span>Profile</span>
        <button onClick={onLogout}>Logout</button>
      </div>
    </nav>
  );
}

export default Navbar;
